    useEffect(()=>{
        axios.get('http://localhost:3001/api/peliculas')
        .then(res => res.data)
        .then(peliculas => { console.log(peliculas)
            return setMovies(peliculas)})
    },[])



    return (
        <div>
          <Navbar />

          <Routes>
              <Route path="/search" element={<Search />}/>
              <Route path="/:type" element={<HomeMovies />}/>
              <Route path="/:type" element={<Search />}/>
          </Routes>


          </div>
    )}

export default App;
